export const RevealUpcoming = () => {
  return (
    <>
      <section>
        <picture>
          <source
            media="(max-width: 991px)"
            srcset="./img/revealEvents/banner-bg-xl.png"
          ></source>
          <img
            src="./img/revealEvents/banner-bg-xl.png"
            alt=""
            height="100%"
          ></img>
        </picture>
      </section>
    </>
  );
};
